    input3: "",
    input4: ""
  })

  const handleChange = (event) => {
    const { name, value } = event.target
    setSearch({...search, [name]: value})
  }

    return(
        <>
        <h2>Search by...</h2>
        <h3>Store name: </h3><input value={search.input1} type="text" onChange={handleChange}/>
        <h3>Zip code: </h3><input type="text"/>
        <h3>Name and zip: </h3><input type="text"/><input type="text"/>
        <button>Search</button>
        </>
    )
}

export default StoreSearch
